        cmp("l = [ [\n [\n   [\n     1\n     2\n    ]\n      ]\n   ]\n     ]", "l = [[[[1,2]]]]");
        console.log(1);
        cmp("l = [[1\n      2]]", "l = [[1,2]]");
        console.log(2);
        cmp("l = [[1\n 2]]", "l = [[1,2]]");
        console.log(3);
        cmp("l = [[1\n    2]\n     ]", "l = [[1,2]]");
